"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[1071],{89500:e=>{e.exports=JSON.parse('{"tag":{"label":"ctf_19.3","permalink":"/docs/tags/ctf-19-3","allTagsPath":"/docs/tags","count":14,"items":[{"id":"checkoutcode","title":"Check Out Code","description":"You can use the checkout command to check out the code from Subversion or GIT repository.","permalink":"/docs/checkoutcode"},{"id":"BaselinePages/create-baseline","title":"Create and View Baselines","description":"Create a Baseline when you accomplish specific milestones in your project or when you release or deliver a product. You can create a Baseline from either a Baseline Definition or from the ground up.","permalink":"/docs/BaselinePages/create-baseline"},{"id":"BaselinePages/create-project-baseline","title":"Create and View Project Baselines","description":"A Project Baseline is a baseline created on a project at a given point in time. Once you have Project Baselines created, you can kick start new projects from Project Baselines and proceed from when and where the Project Baselines were created in the past. Project Baselines are typically created using Project Baseline Definitions, when you release or deliver a product. You can create as many Project Baselines as required.","permalink":"/docs/BaselinePages/create-project-baseline"},{"id":"releases","title":"File Releases and Packages","description":"You can publish the output of your project to selected audiences as packages and releases.","permalink":"/docs/releases"},{"id":"installpages/allinoneserver_rhel_centos","title":"Install All Services on a Single RHEL/CentOS Server","description":"The easiest way to install TeamForge is to install it on a single server, dedicated to TeamForge taking the default configuration settings.","permalink":"/docs/installpages/allinoneserver_rhel_centos"},{"id":"IntegrationPages/installnexusplugin","title":"Install or Upgrade the TeamForge\u2014Nexus Integration Plugin","description":"Once you have your Nexus server set up, install the TeamForge-Nexus integration plugin.","permalink":"/docs/IntegrationPages/installnexusplugin"},{"id":"installpages/distributed_install_rhel_centos","title":"Install TeamForge in a Distributed Setup","description":"Distributed setup with TeamForge, Database (including Datamart), Review Board, SCM (Subversion and Git), Code Search and Baseline installed on separate servers.","permalink":"/docs/installpages/distributed_install_rhel_centos"},{"id":"installpages/dbdm-on-nonctfmanaged-postgresserver","title":"Install TeamForge with an External PostgreSQL Server","description":"You can install TeamForge with its database installed separately on an external PostgreSQL server such as AWS RDS/Aurora.","permalink":"/docs/installpages/dbdm-on-nonctfmanaged-postgresserver"},{"id":"installpages/install_teamforge_with_oracle","title":"Install TeamForge with Oracle Database","description":"Distributed setup with TeamForge and Oracle Database (including Datamart) installed on separate servers.","permalink":"/docs/installpages/install_teamforge_with_oracle"},{"id":"installpages/requirements","title":"Installation Requirements","description":"Here\'s what it takes to install and run TeamForge and other integrations supported by TeamForge.","permalink":"/docs/installpages/requirements"},{"id":"setuplfs","title":"Set up LFS","description":"Git Large File Storage (LFS) is a Git extension for versioning large files. Git LFS replaces large files such as audio samples, videos, datasets, and graphics with text pointers inside Git, while storing the file contents on a separate server (typically a remote server).","permalink":"/docs/setuplfs"},{"id":"release-notes/siteoptionschangelog","title":"Site Options Change Log","description":"Change log of site-options.conf tokens.","permalink":"/docs/release-notes/siteoptionschangelog"},{"id":"IntegrationPages/managebinaries","title":"TeamForge Binary Integration Overview","description":"An important aspect of the end-to-end development lifecycle is the creation and storage of software packages that are often binary artifacts. In the Java world, these are usually reusable jars that are used by other projects. Binary artifact repository managers are software systems that manage, version, and store binary artifacts. Example of such repository manager is Sonatype Nexus.","permalink":"/docs/IntegrationPages/managebinaries"},{"id":"loadbalancing","title":"TeamForge Load Balancing Setup","description":"Installing TeamForge in a Load Balancing setup ensures distribution of processing load between multiple servers. The HAProxy Server hosts the HAProxy services that are required for the load balancing function.","permalink":"/docs/loadbalancing"}],"unlisted":false}}')}}]);